import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

import {withStyles} from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import CardContent from  "@material-ui/core/CardContent";
import CardMedia from  "@material-ui/core/CardMedia";
import CardActions from  "@material-ui/core/CardActions"

const styles = theme => ({
  card : {
    maxWidth: 322
  },
  media : {
    width: 322,
    height: 322
  },
  header : {
    textAlign : "center"
  }
});

const loginCard = withStyles(styles)(({classes}) => (
  <Card className = {classes.card}>
    <CardMedia
      className = {classes.media}
      image = "https://images.unsplash.com/photo-1504204267155-aaad8e81290d?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1650&q=80"
      title = "홈텔리어 매니저 전용앱 사진" 
      />
    <CardHeader
      className= {classes.header}
      title = "홈텔리어 매니저 전용앱"
      subheader = "매니저"
    />  
  </Card>
))

export default loginCard();

